var tipuesearch = {"pages": [{'title': 'About', 'text': 'cmsimde_site \n', 'tags': '', 'url': 'About.html'}, {'title': 'W4', 'text': '20 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \xa0影片連結-20 \n \n 20 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \xa0影片連結-21 \n \n 22 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \xa0影片連結-22 \n \n \n \n 23 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \xa0影片連結-23 \n \n \n \n 24 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \xa0影片連結-24 \n \n', 'tags': '', 'url': 'W4.html'}, {'title': 'midterm', 'text': '使用onshape組裝機械手臂 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n 心得:這次我分配到組裝零件，剛開始還不太會使用onshape組裝，所以在組裝時常常會發生過多限制使組合件無法做出相對運動 加上在看圖時沒有注意到方向性，導致後來有部分需要重新組裝，好在最後有組裝完成 \n \n \n', 'tags': '', 'url': 'midterm.html'}, {'title': 'HW', 'text': '', 'tags': '', 'url': 'HW.html'}, {'title': 'W7', 'text': '\n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W10', 'text': '', 'tags': '', 'url': 'W10.html'}, {'title': 'w10_block_ui', 'text': '\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w10_block_ui.html'}, {'title': 'w10_nx_integ', 'text': '\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w10_nx_integ.html'}, {'title': 'w10_ssh.wnk', 'text': '\n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w10_ssh.wnk.html'}, {'title': 'W12', 'text': '\n', 'tags': '', 'url': 'W12.html'}, {'title': 'Graduate School', 'text': '學長推甄與考研的相關心得 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'Graduate School.html'}, {'title': 'cadlab startup', 'text': '\n 利用批次檔案關閉 IPv4, Proxy 自動偵測, 自行設定 IPv6 DNS 與 Proxy. \n 利用 Hybrid 啟動可攜系統. \n 利用 .reg 設定 Putty session. \n 啟動可攜系統時同時開啟位於 F: 中的 NX2008 \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'cadlab startup.html'}, {'title': 'NXOpen Python', 'text': '\n 選擇將 NXOpen Journal 檔案儲存格式設為 Python. File -> Preferences -> User Interface -> Tools -> Journal -> Journal Language 選擇存為 Python. \n 在NX 上方功能表最右方的 Toolbar Options 選項設定中, 開啟 Menu 表單, 從 Menu -> Tools -> Journal 中可以選擇 Play, Record 或 Edit 功能. \n 利用 NXOpen Python 以遞迴方式, 從已經開啟的 uarm 機械手臂組立檔案中, 查詢各零件的物理性質, 列出各零件的體積後, 計算各零件的重量 \n \n \n \n \n \n   \n \n \n', 'tags': '', 'url': 'NXOpen Python.html'}, {'title': 'W16', 'text': '\n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W16.html'}, {'title': '期末考周', 'text': '使用NX12修改 front joint \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \n \n \n 使用NX12 修改 絞鍊 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n 心得:修改front joint和絞鍊並不難，而且我在期中考周時也有使用onshape組裝過機械手臂，雖然剛開始在組裝時花了一段時間摸索其約束指令和結合方式，但了解後發現其實NX的組裝方式還蠻容易上手的所以後面再重新組裝機械手臂時還蠻順利的 \n \n \n \n \n 使用coppeliasim模擬 front joint \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \n \n \n \n uarm 三軸作動\xa0 連結 \n 心得:剛開始在使用coppeliasim時，因為英文不好所以完全不知道該如何下手，後來詢問同學，並觀看同學的如何操作和反覆和對老師的成品後，終於完成了。 \n \n \n \n \n uarm 吸起方塊\xa0 連結 \n 心得:我在完成uarm 三軸作動後，對coppeliasim的操作有了一定程度的了解，並且何同學討論後，很快地就成功使用uarm 吸起方塊 \n \n \n \n', 'tags': '', 'url': '期末考周.html'}]};